import {makeStyles} from '@material-ui/styles';

const centeredStyleObj={
    display:'flex',
    alignItems:'column',
    justifyContent:'center'
}

export default makeStyles({
    cardContainer:{
        marginBottom:8,
        ...centeredStyleObj
    },
    poster:{
        width:120,
        ...centeredStyleObj
    },
    titlesContainer:{
        paddingLeft:8,
        ...centeredStyleObj
    }
})
